import React from 'react'

function PageProductMobile(title, category, image, price, ratingStar, ratingNumber, prime, url) {
    return (
        <main className="pageProductMobile">
            <div className="pageProductMobile__image__container">
                <div>{title}</div>
            </div>
            
         
        </main>
    )
}

export default PageProductMobile
